import React from 'react';
import firebase from "firebase/app";

import * as fb from "./firebase.js";
import * as fbRTDB from "./firebaseRTDB.js";

import { notify } from "./notify.js";

var starCountRef = firebase.database().ref('Sensors/test');



function testSuccess(dbData) {
    notify(dbData);
    //valListener.innerHTML = dbData;
    console.log(dbData);
}
const About = () => {

    starCountRef.on('value', (snapshot) => {
        const data = snapshot.val();
        testSuccess(data);
    });

    return(
        <div>
            <h2>about Page</h2>
        </div>
    )
}

export default About;
